function waitForElement(r){return new Promise(o=>{new MutationObserver((e,t)=>{var n=document.querySelector(r);n&&(t.disconnect(),o(n))}).observe(document.body,{childList:!0,subtree:!0})})}document.addEventListener("DOMContentLoaded",function(){waitForElement(".navbar .title").then(e=>{e.prepend('<h1 id="site-title">AzCaNE</h1>')})});